    false,nt"url": null,nt"notes": "NODC Accession 0123055 contains raw underway
    navigational, physical and time series data logged by the Scientific Computer System
    (SCS) aboard NOAA Ship Thomas Jefferson in the North Atlantic Ocean from 2013-06-17
    to 2013-10-02. Office of Marine and Aviation Operations (OMAO) personnel aboard
    the ship submitted these data and associated metadata to NODC. In addition, NODC
    Accession 0123055 contains supplementary cruise-level metadata, which OMAO personnel
    logged in the Ship Daily Activity Log (SDAL). OMAO and NODC personnel developed
    the automated process to archive these data under the auspices of the NOAA Rolling
    Deck to Repository (NOAA R2R) program.",nt"license_title": null,nt"extras":
